window.bookSummaryJSON = "<p><b>\"These veteran narrators keep the plot moving and the narration fresh\" (</b><b><i>AudioFile Magazine</i></b><b>)</b><br> <br> <b>This program is read by Audie Award-winning narrators Michael Kramer and Kate Reading, and includes a bonus interview with the author.</b><br> <br> <b>Now an original series starring Rosamund Pike as Moiraine!</b><br> <br> <b>The first novel in Robert Jordan's #1 </b><b><i>New York Times</i></b><b> bestselling epic fantasy series, The Wheel of Time®.</b><br> <br> The Wheel of Time turns and Ages come and pass, leaving memories that become legend. Legend fades to myth, and even myth is long forgotten when the Age that gave it birth returns again. What was, what will be, and what is, may yet fall under the Shadow.<br> <br> Moiraine Damodred arrives in Emond’s Field on a quest to find the one prophesized to stand against The Dark One, a malicious entity sowing the seeds of chaos and destruction. When a vicious band of half-men, half beasts invade the village seeking their master’s enemy, Moiraine persuades Rand al’Thor and his friends to leave their home and enter a larger unimaginable world filled with dangers waiting in the shadows and in the light.<br> <br> <b>Since its debut in 1990, The Wheel of Time® has captivated millions of readers around the globe with its scope, originality, and compelling characters.</b><br> <br> <b>The Wheel of Time®</b><br> <i>New Spring: The Novel</i><br> #1 <i>The Eye of the World</i><br> #2 <i>The Great Hunt</i><br> #3 <i>The Dragon Reborn</i><br> #4 <i>The Shadow Rising</i><br> #5 <i>The Fires of Heaven</i><br> #6 <i>Lord of Chaos</i><br> #7 <i>A Crown of Swords</i><br> #8 <i>The Path of Daggers</i><br> #9 <i>Winter's Heart</i><br> #10 <i>Crossroads of Twilight</i><br> #11 <i>Knife of Dreams</i><br> <br> <b>By Robert Jordan and Brandon Sanderson</b><br> #12 <i>The Gathering Storm</i><br> #13 <i>Towers of Midnight</i><br> #14 <i>A Memory of Light</i><br> <br> <b>By Robert Jordan and Teresa Patterson</b><br> <i>The World of Robert Jordan's The Wheel of Time</i><br> <br> <b>By Robert Jordan, Harriet McDougal, Alan Romanczuk, and Maria Simons</b><br> <i>The Wheel of Time Companion</i><br> <br> <b>By Robert Jordan and Amy Romanczuk</b><br> <i>Patterns of the Wheel: Coloring Art Based on Robert Jordan's The Wheel of Time</i></p>"; 
